import React from 'react'


const Form = ({isOpen, onClose}) => {

    return(
        <>
            <div className="fixed inset-0 flex items-center justify-end bg-gray-500 bg-opacity-75">
                <div className="relative bg-white w-1/3 h-full p-6 shadow-lg">
                    <button
                    className="absolute top-2 right-2 text-gray-600 hover:text-gray-800"
                    onClick={onClose}
                    >
                    &times;
                    </button>
                    {/* Modal Content */}
                    <h2 className="text-xl font-bold">Modal Header</h2>
                    <p className="mt-4">This is the modal content.</p>
                    {/* You can include a form or other components here */}
                </div>
            </div>
        </>
    )
}

export default Form
